import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';


const pino = require("pino");
const logger = pino({
  transport: {
    target: "pino-pretty",
  },
});

logger.info(`Hello World`);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
